public class Memberone {

	private String uname,email, registeras, password;

	public Memberone() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Memberone(String uname, String email, String registeras, String password) {
		super();
		this.uname = uname;
		this.email = email;
		this.registeras = registeras;
		this.password = password;
	}
	public String getUname() {
		return uname;
	}
	public void setUname(String uname) {
		this.uname = uname;
	}
	public String getEmail() {
		return email;
	}
	public void setEmail(String email) {
		this.email = email;
	}
	public String getRegisteras() {
		return registeras;
	}
	public void setRegisteras(String registeras) {
		this.registeras = registeras;
	}
	public String getPassword() {
		return password;
	}
	public void setPassword(String password) {
		this.password = password;
	}

	
}
